// Function to create a plane trace at a specific Z value
function createPlaneTrace(z_value, x_range, y_range, name) {
    var x = [x_range[0], x_range[1], x_range[1], x_range[0]];
    var y = [y_range[0], y_range[0], y_range[1], y_range[1]];
    var z = [z_value, z_value, z_value, z_value];
    return {
        type: 'mesh3d',
        x: x,
        y: y,
        z: z,
        color: 'rgba(255,0,0,0.5)', // Example: red with some transparency
        name: name
    };
}
